export function add17(a: number, b: number): number {
  return a + b;
}

export function subtract17(a: number, b: number): number {
  return a - b;
}

export function multiply17(a: number, b: number): number {
  return a * b;
}

export function divide17(a: number, b: number): number {
  return a / b;
}
